      "text": "What does 'this' keyword refer to inside a function?",
      "answersCount": 3,
      "answers": [
        {
          "text": "The global object",
          "explanation": "In global scope, 'this' refers to the global object, but within functions, it's more context-dependent.",
          "isCorrect": false
        },
        {
          "text": "The function itself",
          "explanation": "This is incorrect; 'this' refers to the object on which the function is called.",
          "isCorrect": false
        },
        {
          "text": "The object on which the function is called",
          "explanation": "This is correct; 'this' refers to the object that invokes the method.",
          "isCorrect": true
        }
